Aig Carnwarth , Lancs ,
tha meall neonach fo choill ris an abrar The Moat ;
tha arsadairean ag creidsinn gur ceann e de aiteachan - suidhe an “ Witanagemot , ” agus theirear le beul - aithris gu ’ m bheil toll air a ’ mhullach a ruigeas gus an taobh asteach . Ma leigear le cloich tuiteam sios an toll , cluinnear gleadhraich a ’ mhiotaillt , ach dh ’ fhairtlicheadh air gach oidhirp a thugadh riamh chuige so le feirg nan duilean . Chuartaich mise an tom agus dh ’ fhairtlich orm fein an toll ’ fhaotainn ; gidheadh , tha lag air a ’ mhullach agus ma dh ’ fhaoidte rinneadh e le obair luchd - toir an ionmhais .
